import React from 'react';

const NotificationDropdown = ({ onClose, onClearNotifications }) => {
  const notifications = [
    { id: 1, text: 'Alex Rossi liked your profile', time: '2 min ago' },
    { id: 2, text: 'New booking request from Fabric London', time: '1 hour ago' },
    { id: 3, text: 'Marco accepted your connection', time: '3 hours ago' }
  ];

  return (
    <div className="notifications-dropdown">
      <div className="notifications-header">
        <span>Notifications</span>
        <button onClick={onClearNotifications}>Clear all</button>
      </div>
      <div className="notifications-list">
        {notifications.map(notif => (
          <div key={notif.id} className="notification-item">
            <p>{notif.text}</p>
            <span className="notification-time">{notif.time}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default NotificationDropdown;
